const TablaProductos = (props) =>{
    
    
    return(
        <table>
            <thead>
                <tr>
                    <th>Nombre</th>
                    <th>Precio</th>
                </tr>
            </thead>
            <tbody>
                {props.productos.map((prodcuto) =>(
                    <tr>
                        
                        <td>{prodcuto.price}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    )
}

export default TablaProductos;
